import React from "react";
import { Router } from "@reach/router";

import Issue from "../issue/Issue";
import IssueList from "../issue/IssueList";

const AppRouter = () => (
  <Router>
    <IssueList path="/" />
    <Issue path="/issues/:id" />
  </Router>
);

export default AppRouter;
